// 2976. Minimum Cost to Convert String I
// https://leetcode.com/problems/minimum-cost-to-convert-string-i/description/
// Floyd Warshall's Algorithm
// T.C: O(V^3)
// S.C: O(V^2)
/**
 * @param {string} source
 * @param {string} target
 * @param {character[]} original
 * @param {character[]} changed
 * @param {number[]} cost
 * @return {number}
 */
var minimumCost = function (source, target, original, changed, cost) {
  const a = 'a'.charCodeAt(0);
  const graph = Array.from({ length: 26 }, () => new Array(26).fill(Infinity));
  for (let i = 0; i < 26; ++i) {
    graph[i][i] = 0;
  }
  for (let i = 0; i < original.length; ++i) {
    let x = original[i].charCodeAt(0) - a;
    let y = changed[i].charCodeAt(0) - a;
    let z = cost[i];
    graph[x][y] = Math.min(graph[x][y], z);
  }

  for (let k = 0; k < 26; ++k) {
    for (let i = 0; i < 26; ++i) {
      for (let j = 0; j < 26; ++j) {
        graph[i][j] = Math.min(graph[i][j], graph[i][k] + graph[k][j]);
      }
    }
  }

  let result = 0;
  let n = source.length;
  for (let i = 0; i < n; ++i) {
    let x = source.charCodeAt(i) - a;
    let y = target.charCodeAt(i) - a;
    if (x === y) continue;

    if (graph[x][y] >= Infinity) return -1;
    result += graph[x][y];
  }
  return result;
};

var source = 'abcd',
  target = 'acbe',
  original = ['a', 'b', 'c', 'c', 'e', 'd'],
  changed = ['b', 'c', 'b', 'e', 'b', 'e'],
  cost = [2, 5, 5, 1, 2, 20];
var expected = 28;
var result = minimumCost(source, target, original, changed, cost);
console.log(result, result === expected);

